--12 Cree una tabla nueva ciudades (ID, Cuidad, PaisPertenece, Población, TasaNatalidad)
CREATE TABLE Ciudades 
(
	ID INT NOT NULL PRIMARY KEY,
	Ciudad NVARCHAR(50),
	PaisPertenece NVARCHAR(50),
	Poblacion INT,
	TasaNatalidad DECIMAL(5,2)
)

--13 Cree Primary Key, índice agrupado (Cuidad) y no agrupado (PaisPertenece)
